import React from 'react';
import { connect } from 'react-redux';
import {Link} from 'react-router-dom'
import {logout} from '../actions/actions.auth'

const Navs2 = ({logout}) => {
    return (
      <div>
        <Link onClick={logout}>Logout</Link>
      </div>
    )
}

export default connect(null,{logout})()
